import React from 'react';
import './styles.css';

const Home = () => {
  return (
    <div className="home">
      <h1>Bienvenido a Home</h1>
      <p>Explora nuestro contenido y conoce más sobre nosotros.</p>
    </div>
  );
};

export default Home;
